inline fun <T, K, V> Iterable<T>.associate( transform: (T) -> Pair<K, V>
): Map<K, V> 次のような使い方ができます。 data class User(val name: String, val score: Int)
fun main() { val list = listOf(User("Tom", 30), User("John", 99), User("James", 77)) val map = list.associate{it.name to it} println(map) //{Tom=User(name=Tom, score=30), John=User(name=John, score=99), James=User(name=James, score=77)}
} playground 上述の toMap を使用して以下のように書くこともできます。 data class User(val name: String, val score: Int)
fun main() { val list = listOf(User("Tom", 30), User("John", 99), User("James", 77)) val map = list.map{it.name to it}.toMap() println(map) //{Tom=User(name=Tom, score=30), John=User(name=John, score=99), James=User(name=James, score=77)}
} playground

