): Map<K, List<T>> 次のように使用することができます。 桁数ごとにグルーピング fun main() { val list = listOf(1234,12,2,34,1234,6,1,0,-9587,-95,-921) val map = list.groupBy{ var ret = 0 var value = if (it > 0) {it} else {-it} while (value > 0) { ret = ret + 1 value = value / 10 } ret } println(map) // {4=[1234, 1234, -9587], 2=[12, 34, -95], 1=[2, 6, 1], 0=[0], 3=[-921]}
} playground

