一般的なSetでは重複が許されません。 また、順序を持たないため i 番目へのアクセス などの概念がありません。 そのため、次のようなコードにより List から重複を排除することができます。 val list: List<Int> = listOf(1, 1, 2, 3, 5, 8, 13, 21)
// dedupList: [1, 2, 3, 5, 8, 13, 21] になる
val dedupList: List<Int> = list.toSet().toList() Kotlin では distinct() メソッドがあるため、重複を排除したい場合は distinct() メソッドを使用するほうが分かりやすいです。 ※ 内部の実装 では同様の操作を行っています。

