畳み込み関数です。 順々に関数を適用していきます。 fun <T, R> Iterable<T>.fold( initial: R, operation: (acc: R, T) -> R
): R 例えば、次のようにすると簡単に階乗が計算できます。 fun main() { println((1..10).reduce{a, b -> a * b}) // 9! = 362880
} また、reduce の 初期値ありバージョンが fold です。 これを利用すると以下のようにフィボナッチ数列の項も求められます。 fun main() { println((3..10).fold(Pair(1,1)){(a,b), _ -> Pair(b, a+b)}.second) // 55
}
